import {NAV_BAR_CLICK} from '../contants/NavBar';
import {menu} from  '../../data/menu';

const initialState = {
    selectedInfo : menu[0]
}

export default (state = initialState, action) => {
    switch (action.type) {

    case NAV_BAR_CLICK:
        console.log(NAV_BAR_CLICK);
        return state

    default:
        return state
    }
}
